import React, {useState} from "react";

function Playlist() {

    const songs = [];




    const playlistArray = songs.map(song=>
        <li key={song.title}>
            <p>{song.title}</p>
            <p>{song.artist}</p>
            <p>{song.album}</p>
            <button 
                type='button'
                /*onClick={removeFromPlaylist}*/
            >-</button>

        </li>
    )


    return(
        <>
            <h2>Playlist</h2>
            <ul>
                {playlistArray}
            </ul>
            <button type="button">Save to Spotify</button>
        </>

    )
}

export default Playlist;
